def householder(x):
    vec = np.array(x, dtype=float, copy = True)
    if vec.ndim != 1:
        raise ValueError("vec.ndim = %s, expected 1" % vec.ndim)
    v = np.zeros_like(vec)
    v[0] = norm(vec)

    if norm(vec) > 0:
        d = vec.copy()
        d[0] = -np.sum(vec[1:]**2) / (vec[0] + norm(vec))
        u = d / norm(d)
    else:
        u = (vec - v) / norm(vec - v)
    u = np.reshape(u, (1, x.shape[0])) 
    H = np.eye(vec.shape[0]) - 2 * u.T @ u

    return v, H

